import PropTypes from 'prop-types';
import Button from './Button';

const Home = ({ title, onAdd }) => {
    return (
        <div className='header'>
            <h1>{title}</h1>
            <Button color='green' text='Add' onClick={onAdd} />
        </div>
    )
}

Home.defaultProps = {
    title: 'Merchandises'
}

export default Home
